import React, { useState } from "react";
import ImageUpload from "./ImageUpload.jsx";
import ImagePreview from "./ImagePreview.jsx";
import { enhancedImageAPI } from "../utils/enhancedImageApi.js";
import { Link, NavLink } from "react-router-dom";
import { Menu, X, Sun, Moon } from 'lucide-react';


const toggleMenu = () => setIsOpen(!isOpen);
  const toggleDarkMode = () => {
    setDark(!dark);
    document.documentElement.classList.toggle('dark');
  };

const Home = () => {
  const [uploadImage, setUploadImage] = useState(null);
  const [enhancedImage, setEnhancedImage] = useState(null);
  const [loading, setloading] = useState(false);

  const [isOpen, setIsOpen] = useState(false);
  const [dark, setDark] = useState(false);


  // child component function in imageupload.jsx for share the image
  const UploadImageHandler = async (file) => {
    setUploadImage(URL.createObjectURL(file));
    setloading(true);
    // call the api for enhance the image
    // console.log(URL.createObjectURL(file));

    try {
      const enhancedURL = await enhancedImageAPI(file);
      // setEnhancedImage(enhancedURL.image);
      setEnhancedImage(enhancedURL);
      setloading(false);
      // code which may produce error
    } catch (error) {
      console.log(error);
      alert("Error in enhancing the image");
      // code to handle the error and shwo message
    }
  };
  // console.log(enhancedImage);

  const navLinks = [
    { name: "Home", path: "/" },
    { name: "Features", path: "/Features" },
    { name: "Pricing", path: "/Pricing" },
    { name: "Contact", path: "/Contact" },
  ];
  return (
    <>
      <ImageUpload UploadImageHandler={UploadImageHandler} />
      <ImagePreview
        loading={loading}
        uploaded={uploadImage}
        enhanced={enhancedImage?.image}
      />


 {/* Desktop Links */}
      <div className="hidden md:flex space-x-6">
        {navLinks.map((link) => (
          <NavLink
            key={link.name}
            to={link.path}
            className={({ isActive }) =>
              text-lg font-medium hover:text-blue-600 dark:hover:text-blue-400 ${
                isActive
                  ? "text-blue-600 dark:text-blue-400"
                  : "text-gray-700 dark:text-gray-300"
              }
            }
          >
            {link.name}
          </NavLink>
        ))}
      </div>

      {/* Toggle & Menu Icon */}
      <div className="flex items-center space-x-4">
            <button onClick={toggleDarkMode} className="text-gray-700 dark:text-gray-300 hover:text-blue-600">
              {dark ? <Sun size={20} /> : <Moon size={20} />}
            </button>
            <button onClick={toggleMenu} className="md:hidden text-gray-700 dark:text-gray-300">
              {isOpen ? <X size={24} /> : <Menu size={24} />}
            </button>
          </div>

          {/* Mobile Menu */}
      {isOpen && (
        <div className="md:hidden px-4 pb-4">
          {navLinks.map((link) => (
            <NavLink
              key={link.name}
              to={link.path}
              onClick={() => setIsOpen(false)}
              className={({ isActive }) =>
                block py-2 text-lg font-medium hover:text-blue-600 dark:hover:text-blue-400 ${
                  isActive ? 'text-blue-600 dark:text-blue-400' : 'text-gray-700 dark:text-gray-300'
                }
              }
            >
              {link.name}
            </NavLink>
          ))}
        </div>
      )}
    </>
  );
};

export default Home;


